import './App.css';
import {useSelector,useDispatch} from 'react-redux'



function App() {
const selector=useSelector((state)=>state.counter);
const patched=useDispatch();

const increase=()=>{
  patched(increase())
}
const decreaase=()=>{
  patched(decreaase())
}

  return (
    <div>
    <h1>Counter</h1>
    <p>{selector}</p>
    <button onclick={increse}>Increse</button>
    <button onclick={decreaase}>Decrese</button>
    </div>
  );
}

export default App;
